The bubble hasn&#39;t even come close to popping. As you can see in the attached image below, $SPY remains at its second most expensive throughout its 160 year history. This is despite the extreme weakness and overall declines across the last several months. There is still a massive decline coming before the inevitable reversion to the mean.

If you look to Dot-Com Bubble 1.0, the entire market fell by ~90% and took a decade to recover. One of those companies was $AMZN which didn&#39;t recover until after the crash of &#39;08, others like $CSCO still haven&#39;t recovered. On the flip side, well valued companies not pulled into the bubble had significantly lower declines and recoveries.
